script: |
  super -f text -I q10696.spq | sort > q10696.out

inputs:
  - name: q10696.spq
    data: |
      SELECT DISTINCT - + ( + col1 ), col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col0 * col1 AND + CAST ( + col0 AS INTEGER );
  - name: tab1

outputs:
  - name: q10696.out
    data: |
